import React, { useState, useEffect } from 'react';
import { Link } from "react-router-dom";
import './app3.css';
import CourseList from './components/CourseList';
import UserInfo from './components/purchased-admin';

const AdminDashboard = () => {
  const [user, setUser] = useState({ id: '', name: '', email: '', password: '', type: '' });
  const [purchases, setPurchases] = useState([]);
  const [students, setStudents] = useState([]);

  useEffect(() => {
    const fetchUser = async () => {
      try {
        const response = await fetch('http://localhost:5000/api/user');
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        const data = await response.json();
        setUser(data);
      } catch (error) {
        console.error('Error fetching user:', error);
      }
    };

    const fetchPurchases = async () => {
      try {
        const response = await fetch('http://localhost:5000/api/purchases-admin');
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        const data = await response.json();
        setPurchases(data);
      } catch (error) {
        console.error('Error fetching purchases:', error);
      }
    };

    const fetchStudents = async () => {
      try {
        const response = await fetch('http://localhost:5000/api/students');
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        const data = await response.json();
        setStudents(data);
      } catch (error) {
        console.error('Error fetching students:', error);
      }
    };

    fetchUser();
    fetchPurchases();
    fetchStudents();
  }, []);

  const handleDelete = async (studentId) => {
    try {
      const response = await fetch(`http://localhost:5000/api/students/${studentId}`, {
        method: 'DELETE',
      });
      if (response.ok) {
        setStudents(students.filter(student => student._id !== studentId));
      } else {
        throw new Error(`HTTP error! Status: ${response.status}`);
      }
    } catch (error) {
      console.error('Error deleting student:', error);
    }
  };

  if (!user) {
    return <div>Loading...</div>;
  }

  return (
    <div className="app">
      <header>
        <h1>Admin Dashboard</h1>
        <Link to="/">
          <button className="logout">Logout</button>
        </Link>
      </header>
      <div className="content">
        <div className="left-column">
          <UserInfo boughtCourses={purchases} />
          <button onClick={() => fetchStudents()}>Verification</button>
          {students.length > 0 && (
            <table>
              <thead>
                <tr>
                  <th>Name</th>
                  <th>Email</th>
                  <th>Course</th>
                  <th>Percentile</th>
                  <th>Marksheet</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {students.map(student => (
                  <tr key={student._id}>
                    <td>{student.name}</td>
                    <td>{student.email}</td>
                    <td>{student.course}</td>
                    <td>{student.percentile}</td>
                    <td>
                      {student.marksheet ? (
                        <a href={`http://localhost:5000/uploads/${student.marksheet}`} target="_blank" rel="noopener noreferrer">
                          View Marksheet
                        </a>
                      ) : 'No Marksheet'}
                    </td>
                    <td>
                      <button onClick={() => handleDelete(student._id)}>Delete</button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </div>
        <div className="right-column">
          <CourseList status='verified' />
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
